import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from 'react-router-dom';
  import PagesPromotionSearch from './Promotion/Search/Search'
  

  const Root = () => {
      return(
        <Router>
            <div>
            <Switch>

              <Route path="/" component={PagesPromotionSearch} />   

            </Switch>       
            </div>
      </Router>
      )
  }

  export default Root;
